import {_zip2} from '@iterable-iterator/zip';

/**
 * Filters the first input iterable according to truthy and flasy values from a
 * second input iterable. The ith element of the first input iterable is output
 * if and only if the ith element of the second input iterable is truthy.
 *
 * @param {Iterable} iterable - The first input iterable to filter.
 * @param {Iterable} selector - The second input iterable containing the truthy and falsy
 * values.
 * @returns {Iterator}
 */
export default function* compress(iterable, selector) {
	for (const [take, item] of _zip2(selector, iterable)) {
		if (take) {
			yield item;
		}
	}
}

/**
 * Yields all elements from input iterable that verify a given predicate.
 *
 * @example
 * // returns [ 1 , 3 , 5 , 7 , 9 ]
 * list( filter( x => x % 2 , range( 10 ) ) ) ;
 *
 * @param {Function} predicate - A unary function that returns a truthy or
 * falsy value.
 * @param {Iterable} iterable - The input iterable.
 * @returns {IterableIterator}
 */
export default function* filter(predicate, iterable) {
	for (const item of iterable) {
		if (predicate(item)) {
			yield item;
		}
	}
}

/**
 * Yields all elements from input iterable that do not verify a given predicate.
 *
 * @example
 * // returns [ 0 , 2 , 4 , 6 , 8 ]
 * list( filter( x => x % 2 , range( 10 ) ) ) ;
 *
 * @param {Function} predicate - A unary function that returns a truthy or
 * falsy value.
 * @param {Iterable} iterable - The input iterable.
 * @returns {IterableIterator}
 */
export default function* filterfalse(predicate, iterable) {
	for (const item of iterable) {
		if (!predicate(item)) {
			yield item;
		}
	}
}

import filter from './filter.js';

/**
 * Same as {@link filter}.
 * @function filtertrue
 */
const filtertrue = filter;
export default filtertrue;

export {default as compress} from './compress.js';
export {default as filter} from './filter.js';
export {default as filterfalse} from './filterfalse.js';
export {default as filtertrue} from './filtertrue.js';

